      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "1. Es sucht jemand einen sübern Schreibzeugen mit aller Zugehörd und schöner Fason, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "2. Man begehret eine Chaise mit 2 Rädern zu erlangen 2 Plätzen und einem Pferd samt Geschirr, derselbe der Liebhaber ist im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "3. Es wird jemand auf dem Land noch neuen Taback-Brandwein und Honigwachs zu kaufen hat, im Berichthaus dem Kaufer oder dessen persohnlich, oder einem mittelmäßigen, der Liebhaber ist im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "4. Es wird jemand auf dem Land noch neuen Taback-Brandwein und Honigwachs zu kaufen hat, im Berichthaus dem Kaufer oder dessen persohnlich, oder einem mittelmäßigen, der Liebhaber ist im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "5. Man begehret einen möglichsten Kronleuchter mit 8 Lichtern, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "6. Es verlanget jemand eine nicht gar große eiserne Geltkassa zu kaufen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "7. Es verlanget jemand einen guten ausländischen zweithürigen Kasten, der Liebhaber im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "8. Man verlanget einen noch guten Kachel-Ofen mittelmäßiger Größe oder eine Fuß, der Liebhaber ist im Berichthaus zu erfragen, ist aber keinen Bezug."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "1. Ein Losament mitten im Ofsenburger Hof, wie der Augenblick zeigen wird, auf nächste Fasnacht oder Pfingst-Fronfasten zu begehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "2. Ein doppeltes Losament an der Spalen von einer Stuben und Nebenkammer, oder nach Belieben zwei Kammern samt einem schönen Sommerhause, alles auf einem Boden, und nach Belieben Stallung und Heubühne, auf Pfingst-Fronfasten zu begehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "3. Ein Losament mit einem schönen Laden und Laden-Stübchen nebst einem großen Sommerhaus, Stuben, Küchen, 2 große Kammern, einem besonderen Keller, Schlag, ein beschlossener Bau-Schauplatz, auf der Eingangs im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "4. Ein Losament in der Frohschgass von einer Stuben, 2 Kammern und Platz zum Holz, auf Pfingst-Fronfasten zu begehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "5. Ein Losament für 2 Personen in der Weissen Gass, bestehend aus einem Stübchen und Alkoven, Platz zum Hausrath auf einem Boden, einem Boden, und auch Platz zum Holz, Brunnen im Hause, ist zu Pfingst-Fronfasten zu erfragen, im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "6. Ein schönes Losament ebendes Hauses auf der Gass, bestehend aus 3 Stuben, einem großen Saal, Kammern, Küchen, Keller, Platz zum Holz, Garten und Bau-Schauplatz, auf Pfingst-Fronfasten zu begehen, im Berichthaus zu erfragen."
    },
